,taiping:"தைப்பிங்",oddsmiscalculated:"அச்சுக்கலைப் பிழை அல்லது பிற எதிர்பாராத காரணங்களால் வாய்ப்புகள் தவறாகக் கணக்கிடப்பட்டால், பிழையைச் சரிசெய்ய எங்களுக்கு உரிமை உண்டு, மேலும் தீர்வுக்கான அடிப்படையாக புதிய வெற்றி வாய்ப்புகளைப் பயன்படுத்துவோம்.",oddsbettingprincipal:"வாய்ப்புகள் ஏற்கனவே பங்குகளை உள்ளடக்கியது. வெற்றித் தொகை (அசல் தொகை உட்பட) என்பது பந்தயத் தொகையால் முரண்பாடுகளால் பெருக்கப்படும் தொகையாகும்.",oddsfluctuate:"வாய்ப்புகள் அவ்வப்போது ஏற்ற இறக்கமாகவும் மாறக்கூடும். பந்தயம் கட்டும் நேரத்தில் உள்ள வாய்ப்புகளின் அடிப்படையில் இந்த அமைப்பு பந்தயத்தைத் தீர்க்கும். பந்தயம் வைக்கப்பட்ட பிறகு வாய்ப்புகளில் மாற்றம் ஏற்பட்டால், அது வைக்கப்பட்டுள்ள பந்தயங்களைப் பாதிக்காது. புதிய பந்தயங்கள் மட்டுமே புதிய வாய்ப்புகளைப் பயன்படுத்தும்.",oncebetgenerated:"ஒரு பந்தயம் உருவாக்கப்பட்டவுடன் (வெற்றிகரமாக பந்தயம் வைக்கப்பட்டது), அது பந்தயப் பதிவில் ரத்து செய்யப்படலாம்.",anyreasonCauses:"முடிவு நேரத்திற்குப் பிறகு ஏதேனும் காரணத்தால் ஏற்படும் எந்த பந்தயமும் செல்லாததாகக் கருதப்படும்!",platformcancel:"இந்த தளம் பின்வரும் சூழ்நிலைகளில் பந்தயங்களையும் முடிவுகளையும் ரத்து செய்யலாம்:",drawdelayedtoolong:"டிரா மிக நீண்ட நேரம் தாமதமானது.",resultsofthelotterybeenleaked:"சந்தை முடிவதற்கு முன்பே அல்லது லாட்டரி சீட்டு எடுக்கும் நேரம் முன்கூட்டியே முடிவதற்கு முன்பே லாட்டரி முடிவுகள் கசிந்துவிட்டன.",maximumprofitsingleperiod:"ஒரே காலகட்டத்தில் அதிகபட்சமாக திரட்டப்பட்ட லாபம் 700,000,000 VND (அசல் தொகை தவிர்த்து)",northernLotteryGameRules:"வடக்கு லாட்டரி விளையாட்டு விதிகள்",sorthernLotteryGameRules:"மத்திய மற்றும் தெற்கு லாட்டரி விளையாட்டு விதிகள்",colorstructure:"வண்ண அமைப்பு",Lottery:"லாட்டரி பரிசு",numberofPrizes:"பரிசுகளின் எண்ணிக்கை",Number:"எண்",GrandPrize:"சிறப்புப் பரிசு",fivedigits:"ஐந்து இலக்கங்கள்",FirstPrize:"முதல் பரிசு",SecondPrize:"இரண்டாம் பரிசு",ThirdPrize:"மூன்றாம் பரிசு",FourPrize:"நான்காவது பரிசு",FivePrize:"ஐந்தாவது பரிசு",SixPrize:"ஆறாவது பரிசு",fourdigits:"நான்கு இலக்கங்கள்",threedigits:"மூன்று இலக்க எண்கள்",SevenPrize:"ஏழாவது பரிசு",EightPrize:"எட்டாவது பரிசு",seconddigits